import React from 'react'
function dateday()
{
        date = new Date;
        annee = date.getFullYear();
        moi = date.getMonth();
        j = date.getDate();
        resultat = '[j]+'/ '+' / '+[moi]+' / '+annee+';
     
        return resultat;
}
export default dateday
